        <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent"
                aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
            <span class="navbar-toggler-icon"></span>
        </button>

        <div class="collapse navbar-collapse" id="navbarSupportedContent">
            <ul class="navbar-nav mr-auto">
                <li class="nav-item active">
                    <form action={{ url_for("homepage") }} method="Post">
                        <input type="hidden" value={{ username }} name="username">

                        <input type="hidden" value={{ username }} name="username">

                        <input type="submit" class="btn btn-link" value="Homepage">
                    </form>
            </ul>
            <form action={{ url_for("personal") }} method="Post" class="form-inline my-2 my-lg-0" id="search">
                <input type="hidden" value={{ username }} name="username">
                <input class="form-control mr-sm-2" type="search"
                       placeholder={{ search_string if search_string else 'Search' }} aria-label="Search" name="search">
                <input type="submit" class="btn btn-outline-success my-2 my-sm-0">
            </form>
            </form>
            {% if username %}
                <div id="drop" class="dropdown">
                    <button class="btn btn-secondary dropdown-toggle navUser" type="button" id="dropdownMenuButton1"
                            data-bs-toggle="dropdown" aria-expanded="false">
                        {{ username }}
                    </button>
                    <ul class="dropdown-menu" aria-labelledby="dropdownMenuButton1">
                        <li><a class="dropdown-item" href="#">Profile</a></li>
                        <li><a class="dropdown-item" href={{ url_for("login") }}>Quit</a></li>
                    </ul>
                </div>
            {% else %}
                <div class="login-menu">
                    <a id="login-btn" href={{ url_for("login") }} class="btn btn-primary navUser">
                    Please log in
                    </a>
                </div>
            {% endif %}

        </div>
    </nav>
</div>

<!-- navbar end -->

<div class="container rounded bg-white mt-5 mb-5 profile-back">
    <div class="row profile-back">
        <div class="col-md-3 border-right">
            <div class="d-flex flex-column align-items-center text-center p-3 py-5">
                <img
                        class="rounded-circle mt-1 mb-3"
                        width="150px"
                        src="/static/images/{{ profilePicture }}"><span
                    class="font-weight-bold">{{ name }}  </span><span
                    class="text-black-50"> {{ email }}</span></div>

            <form class="upload" action={{ url_for("uploaded") }} method="POST" enctype="multipart/form-data">
                <input type="hidden" value={{ username }} name="username">
                <input type="file" class="profile-input mb-2" name="profilePicture" accept="image/*" capture required>
                <input type="submit" class="btn btn-primary btn-sm profile-button" value="Change Picture">
            </form>

        </div>
        <div class="col-md-5 border-right">
            <div class="p-3 py-5">
                <div class="d-flex justify-content-start align-items-center mb-3">
                    <h4 class="text-right">Profile Information</h4>
                </div>
                <div class="row mt-3">
                    <div class="col-md-12"><label class="labels">Name: {{ name }} </label></div>
                    <div class="col-md-12"><label class="labels">Matriculation: {{ matriculation }} </label></div>
                    <div class="col-md-12"><label class="labels">Birthdate: {{ birthdate }}</label></div>
                    <div class="col-md-12"><label class="labels">Gender: {{ gender|capitalize }}</label></div>
                    <div class="col-md-12"><label class="labels">Street name: {{ street_number }}</label></div>
                    <div class="col-md-12"><label class="labels">Postcode: {{ postcode }}</label></div>
                    <div class="col-md-12"><label class="labels">City: {{ city }}</label></div>
                </div>
                <div class="row mt-3">
                </div>
                <div class="mt-5 text-center">
                </div>
            </div>
        </div>
        <div class="col-md-4">
            <div class="p-3 py-5">
                <div class="d-flex justify-content-start align-items-center mb-3">
                    <h4 class="text-left">Book History</h4>
                </div>
                {% for i in rented_books %}
                    <div class="col-md-12 mb-1"><label class="labels">{{ library_data["Title"][i|int] }}</label></div>

                    <form action={{ url_for("returned") }} method = "POST">
                    <input type="hidden" value={{ username }} name="username">
                    <input type="hidden" value={{ i }} name="book_id">
                    <input type="submit" class="btn btn-primary profile-button" value="Return">
                    </form>
                {% endfor %}
                {% for i in book_history %}
                    <div class="col-md-12 mb-1"><label class="labels">{{ library_data["Title"][i|int] }}</label></div>

                {% endfor %}


            </div>
        </div>
    </div>
</div>
</div>
</div>


</body>
</html>
